import { createIcon } from "../icon/createIcon";

export const ChevronUpIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ChevronUpIcon">
    <path d="M6.093 2.5 11.5 8.552l-.847.948-4.59-5.137L1.334 9.5.5 8.538 6.059 2.5l.016.019.018-.019z" />
  </svg>,
  "ChevronUp",
  "chevron up"
);
